import imagen1 from './imagenes/rey_atanagildo.png'
import imagen2 from './imagenes/rey_sisebuto.png'
import './App.css';

function App() {
  return (
    <>
      <div className='caja'>
        <button className='btn btn-success'>Aceptar</button>
        <img src={imagen1} />
        <input className='campo'/>
      </div>
    </>
  );
}

export default App;
